import React from 'react';
import './ProductsSearch.css';

export default function ProductsSearch(props) {
  return (
    <div>
      <div><img src={props.thumbnail} alt={props.thumbnail}></img></div>
      <div>{props.name}</div>
    </div>
  )
}
